import './todo-item/todo-item.css'
import {TodoItem} from './todo-item/todo-item.jsx'

export function TodoColumn({checkItem, removeItem, editItem, todos}) {
  return (
    <div className="todo__col">
      <h1>TO DO:</h1> 
      {
        todos.map((todo, index) => {
          if (todo.isDone) {
            return  () => {}
          }

          return (
            <TodoItem 
              key={index} 
              itemIndex={index} 
              removeItem={removeItem(index)} 
              title={todo.title} 
              checkItem={checkItem}
            />
          );
        })
      }

    </div>
  )
}
